/*
  ./src/scss/app.scss

 */
// FICHIER DE SURCHARGE

@import './ieps_framework/index.scss';

body {
    background: radial-gradient(at top, $color-1 10px, $color-2 60%);
}

//MAIN HEADER
.main-header {
    a {
        color: $color-neutral-4;
    }
    nav {
        background: rgba($color-neutral-4, 0.1);
    }
    &.logo-link {
        text-decoration: none;
        display: block;
        width: 200px;
        border: 4px solid $color-neutral-4;
        margin: auto;
        padding: 0.5rem;
        margin: 4rem auto 2rem auto;
    }
}

//MAIN CONTENT
.main-content {
    background: $color-neutral-4;
    padding: 8rem 8rem 6rem 8rem;
}

//MAIN FOOTER
.main-footer {
}

//FOOTER
.copyright {
    span {
        margin: 0.5rem;
    }
    color: $color-neutral-3;
    margin: 2rem 0 5rem 0;
    text-align: center;
    text-transform: uppercase;
    letter-spacing: 0.1rem;
    a {
        color: $color-neutral-3;
        &:hover {
            color: white;
        }
    }
}

//IMAGE PART
img {
    &.float-left {
        width: 210px;
        margin: 0.75rem 1rem 0;
        // padding-top: 0.75rem;
    }
    &.float-right {
        width: 210px;
        margin: 1.2rem 0 0 1rem;
    }
}
.text-image {
    margin-top: 2rem;
}

//FOOTER
.footer-content {
    background: $color-neutral-2;
    flex-direction: column;
    display: flex;
    form {
        border-right: 2px solid red;
    }
    a {
        text-decoration: none;
    }
    address {
        border-bottom: 2px solid blue;
    }
    h4 {
        color: $color-neutral-3;
    }
}

