table {
    caption {
        text-transform: uppercase;
        font-weight: 900;
        font-family: $font-2;
        text-align: left;
        margin-bottom: 2rem;
    }
    border-spacing: 0;
    margin: $margin-table;
    font-size: $font-size-table;
    text-align: $text-align-table;
    width: 100%;

    thead {
        text-transform: $text-transform-thead;
