//BTN ALIGNES
$display-btn-div: flex;
$align-items-btn-div: flex-start;

//----------------------------
//BUTTONS SPECIFICATIONS
//----------------------------
.inline {
    display: $display-btn-div;
    align-items: $align-items-btn-div;
    list-style: none;
    padding: 0;
}
button,
.btn {
    display: $display-btn;
    font-size: $font-size-btn;
    font-weight: $font-weight-btn;
    font-family: $font-family-btn;
    padding: $padding-btn;
    border: $border-btn;
    letter-spacing: $letter-spacing-btn;
    text-decoration: $text-decoration-btn;
    text-transform: $text-transform-btn;
    margin: $margin-btn;
    background: $background-btn;
    color: $color-btn;

    &:hover {
        border: $border-btn-hover;
        color: $color-neutral-4;
        background: $background-btn-hover;
    }
    &.small {
        padding: $padding-btn-small;
    }

    &.large {
        padding: $padding-btn-large;
    }
    &.fit {
        font-size: $font-size-fs-btn;
    }
    &.icon {
    }
    &.less {
        background: $background-btn-less;
        color: $color-btn-less;
        &:hover {
            border: $border-btn-hover;
            color: $colorHover;
        }
    }
    &.opacity {
        opacity: $opacity-btn;
    }
}

